import unittest
from Solution import Solution

# Given a 2D board and a word, find if the word exists in the grid.
#
# The word can be constructed from letters of sequentially adjacent cell, where "adjacent" cells are those horizontally or vertically neighboring. The same letter cell may not be used more than once.
#
# Example:
#
# board =
# [
#   ['A','B','C','E'],
#   ['S','F','C','S'],
#   ['A','D','E','E']
# ]
#
# Given word = "ABCCED", return true.
# Given word = "SEE", return true.
# Given word = "ABCB", return false.

class TestStringMethods(unittest.TestCase):

    sol = Solution()

    def test_required(self):
        board = [
              ['A','B','C','E'],
              ['S','F','C','S'],
              ['A','D','E','E']
            ]
        self.assertEqual(self.sol.exist(board, 'ABCCED'), True)
        self.assertEqual(self.sol.exist(board, 'SEE'), True)
        self.assertEqual(self.sol.exist(board, 'ABCB'), False)

    def test_tricky_1(self):
        board = [["C","A","A"],["A","A","A"],["B","C","D"]]
        self.assertEqual(self.sol.exist(board, 'AAB'), True)

    def test_tricky_2(self):
        board = [["A","B","C","E"],["S","F","E","S"],["A","D","E","E"]]
        self.assertEqual(self.sol.exist(board, "ABCEFSADEESE"), True)

